import Header from "./Component/Header";
import Home from "./Component/Home";
import Contact from "./Component/Contact";
import Portfolio from "./Component/Portfolio";
import About from "./Component/About";

function App() {
  return (
    <>
    <Header />
    <Home />
    <About />
    <Portfolio />
    <Contact />
    </>
  );
}

export default App;
